DROP TABLE IF EXISTS "AcCurrentStock";
CREATE TABLE `AcCurrentStock` (
	`AcCurrentStockID`	INTEGER PRIMARY KEY AUTOINCREMENT
);
DROP TABLE IF EXISTS "AcItemTransaction";
CREATE TABLE `AcItemTransaction` (
	`AcItemTranID`	INTEGER PRIMARY KEY AUTOINCREMENT
);
DROP TABLE IF EXISTS "Products";
CREATE TABLE "Products" (
	`ID`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	`DrugName`	TEXT,
	`Measures`	TEXT,
	`Packing`	TEXT,
	`Comp`	TEXT,
	`Shelf`	TEXT,
	`BatchNo`	TEXT,
	`Exp`	TEXT,
	`MRP`	NUMERIC,
	`Qty`	INT,
	`Amount`	NUMERIC
);
DROP TABLE IF EXISTS "mst_Category";
CREATE TABLE `mst_Category` (
	`ID`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`CategoryName`	TEXT,
	`BatchNo`	BLOB,
	`Expiry`	BLOB,
	`InSale`	BLOB
);
